def tenagain(d):
    if not checkdice(d, "d10"):
        print("Using non-d10s for tenagain mode");
        return;
    rolls = rollandprint(d, 0, 1);
    successes = 0;
    for r in rolls:
        if r == 10:
            rolls += rollandprint("1d10", 0, 1);
        if r >= 8:
            successes += 1;
    print(rolls);
    print(successes, " successes");

def nineagain(d):
    if not checkdice(d, "d10"):
        print("Using non-d10s for nineagain mode");
        return;
    rolls = rollandprint(d, 0, 1);
    successes = 0;
    for r in rolls:
        if r >= 9:
            rolls += rollandprint("1d10", 0, 1);
        if r >= 8:
            successes += 1;
    print(rolls);
    print(successes, " successes");

